script: |
  super -f text -I q9964.spq | sort > q9964.out

inputs:
  - name: q9964.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT NULL <= col1 + col2 * - - col2 * ( + + 95 ) + + col2 * + col2 - col1 * + + col2 * - CAST ( NULL AS INTEGER ) / ( - col0 );
  - name: tab2

outputs:
  - name: q9964.out
    data: |
